import React from 'react';
import '../App.css';
import profile from '../img/profile.png';


function Stats(){
    return(
<div className="App">
        <nav class="navbar  navbar-dark bg-dark">
            <div class="navbar-brand ">IRUN</div>

            <img src = {profile} className="img-pro"></img>
        
</nav>
</div>
    );

}

export default Stats;
